ernal peril.\n\nDarion: Father, father, I? I feared for your sanity, father, for you, I would give my life a thousand times.",questID=24915,u=33},{mnt(73313,{itemID=52200,u=33})})),i(51319,g({description="Muradin: Oh lad, how I missed those endless days in Lordaeron, sharpening your skill with this dull blade. Forging you into a weapon meant to withstand the demands of a great destiny. Heh? You sure put them skills to use, didn't you lad?\n\nIf only I'd been able to stop you that day, how different things migha' been. If only I'da never discovered that accursed blade. Farewell, Arthas, my brother.",questID=24917,u=33},{toy(52201,{u=33})})),i(51320,g({description="Uther: Arthas... Alas, hero of Azeroth. You give me a greater gift than you know. Long have I struggled to forgive the prince for his terrible transgressions. My soul has been wracked with unbearable anxiety, dark thoughts, distancing me from the light.\n\nI recall clearly... the gleam of pride in his eye as he stood before me, eager to defeat the enemies of the light... eager to defend his people, no matter the cost. It is this memory of Arthas that I choose to keep in my heart.\n\nI shall always be in your debt, friend. Thank you.",questID=24919,u=33},{i(52252,{u=33})})),i(51321,g({description="Sylvanas: So, it is done. I had not dared to trust my senses. Too many times has the Lich King made me to be a fool. Finally, he has been made to pay for the atrocities he imposed upon my people.\n\nMay Azeroth never fail to remember the horrible price we paid for our weakness, for our pride. But what now, Hero? What of those freed from his grasp but still shackled to their mortal coils?\n\nLeave me. I have much to ponder.",questID=24918,u=33},{toy(52253,{u=33})})),i(51318,g({description="Jaina: What's this?\nHe... he kept it.. all this time he kept it!\n<Cries> I knew!\n<Cries> I sensed a part of him still alive... trapped... struggling. Oh Arthas!\nPerhaps he might someday remember from what he once was...\nBy the Light may he at last find rest, free from the icy grip of that terrible blade!",questID=24916,u=33},{i(52251,{u=33})}))}))}))})),n(-17,g({u=33},{q(24815,g({description="If the quest does not appear when you hit Friendly, you may have to relog.",minReputation={1156,3000},qgs=a[186],u=33},{i(50375,{c=a[12],u=33}),i(50377,{c=a[113],u=33}),i(52569,{c=a[12],u=33}),i(50376,{c={3,4,7,10,11,12},u=33}),i(50378,{c=a[113],u=33})})),q(24827,g({c=a[12],minReputation={1156,9000},qgs=a[186],sourceQuests={24815},u=33},{i(50388,{c=a[12],u=33})})),q(24834,g({c=a[12],minReputation={1156,21000},qgs=a[186],sourceQuests={24827},u=33},{i(50403,{c=a[12],u=33})})),q(24835,g({c=a[12],minReputation={1156,42000},qgs=a[186],sourceQuests={24834},u=33},{i(50404,{c=a[12],u=33})})),q(24828,g({c=a[113],minReputation={1156,9000},qgs=a[186],sourceQuests={24815},u=33},{i(50384,{c=a[113],u=33})})),q(24823,g({c=a[113],minReputation={1156,21000},qgs=a[186],sourceQuests={24828},u=33},{i(50397,{c=a[113],u=33})})),q(24829,g({c=a[113],minReputation={1156,42000},qgs=a[186],sourceQuests={24823},u=33},{i(50398,{c=a[113],u=33})})),q(25239,g({c=a[12],minReputation={1156,9000},qgs=a[186],sourceQuests={24815},u=33},{i(52570,{c=a[12],u=33})})),q(25240,g({c=a[12],minReputation={1156,21000},qgs=a[186],sourceQuests={25239},u=33},{i(52571,{c=a[12],u=33})})),q(25242,g({c=a[12],minReputation={1156,42000},qgs=a[186],sourceQuests={25240},u=33},{i(52572,{c=a[12],u=33})})),q(24826,g({c={3,4,7,10,11,12},minReputation={1156,9000},qgs=a[186],sourceQuests={24815},u=33},{i(50387,{c={3,4,7,10,11,12},u=33})})),q(24832,g({c={3,4,7,10,11,12},minReputation={1156,21000},qgs=a[186],sourceQuests={24826},u=33},{i(50401,{c={3,4,7,10,11,12},u=33})})),q(24833,g({c={3,4,7,10,11,12},minReputation={1156,42000},qgs=a[186],sourceQuests={24832},u=33},{i(50402,{c={3,4,7,10,11,12},u=33})})),q(24825,g({c=a[113],minReputation={1156,9000},qgs=a[186],sourceQuests={24815},u=33},{i(50386,{c=a[113],u=33})})),q(24830,g({c=a[113],minReputation={1156,21000},q