 became known to players as the Upside-Down Sinners.",maps={41,43,44,45,46}},{n(-4,{ach(777,{OnClick=_.CommonAchievementHandlers.EXPLORATION_OnClick,OnUpdate=_.CommonAchievementHandlers.EXPLORATION_OnUpdate})}),n(-15,{exp(2697,{maphash="380:365:249:76"}),exp(2562,{maphash="300:245:269:337"}),exp(2561,{maphash="270:270:426:299"})}),n(-2,{n(18255,g({coords={a[205]},u=17},{r(38503,{itemID=31401,requireSkill=755,u=17}),r(42620,{itemID=33165,requireSkill=333,u=19}),r(42546,{itemID=33124,requireSkill=165,u=19}),r(42731,{itemID=33205,requireSkill=165,u=19}),r(42736,{itemID=33209,requireSkill=171,rwp=50001,u=19}),i(29187,{u=17})}))}),n(0,{r(20010,{crs={7372},itemID=16246,requireSkill=333})})})),m(499,g({lore="The Deeprun Tram is a long, fully enclosed, underground (and partially underwater) set of double tracks upon which rolls two sets of three wagons, all credited to the gnomes' technical engineering. The service is fast and smooth, and is provided free of charge to travelers between the Alliance-aligned cities of Ironforge and Stormwind City."},{n(-17,{q(6661,g({lvl=10,qgs={12997},r=2},{qo(1,{crs={13016},providers={{"i",17117}}})})),q(6662,g({cost={{"i",17118,1}},lvl=10,qgs={12997},r=2,sourceQuests={6661}},{i(17119,{f=55,lvl=5,spellID=434})}))})})),m(1426,g({icon="Interface\\Icons\\achievement_zone_dunmorogh",lore="Dun Morogh is home to both the gnomes of Gnomeregan and the Ironforge dwarves and is the location of the major city of Ironforge. The Khaz Modan mountains surround Dun Morogh on all sides, making it accessible only by certain passes that are currently watched over by dwarven troops.\n\nThe center of dwarven culture and ingenuity, Dun Morogh holds the capital of Ironforge. The region is snow-swept and forested, with gray, craggy mountains and slinking wolves. Troggs recently overran Gnomeregan, the gnomes' former capital, and drove its citizens to Ironforge. Frostmane trolls menace dwarven patrols. Several villages and towns dot the landscape, and though the tr