0,{crs={428}})})})),m(1427,g({icon="Interface\\Icons\\achievement_zone_searinggorge_01",lore="Just as Blackrock orcs and their allies dominate Burning Steppes, so Dark Iron dwarves dominate the Searing Gorge. A large population of Dark Iron dwarves, War Golems, and Elementals resides in this dark, mountainous area.\n\nThe climate is very similar to Burning Steppes, as it was the same catastrophe that blackened both: the summoning of Ragnaros. The Searing Gorge is a part of Khaz Modan. Before being shattered by the summoning it was a mountainous region, part of the Redridge Mountains.\n\nLarge mining operations take place in The Cauldron, a giant excavation site forming a huge rift in the middle of the Searing Gorge. The Slag Pit lies within The Cauldron and is an underground mining site rich with multiple types of ore. The mining work is mainly done by slave labor, which consists for the most part of captured enemies.\n\nEver since the Dark Iron dwarves' capital, Thaurissan, was destroyed by the summoning of Ragnaros, they have searched for a landmass to control for their filthy, industrious works. The Searing Gorge was the obvious choice due to a low military presence, scarce population, few settlements, and high vulnerability. The dwarven garrisons were soon overrun by a massive Dark Iron invasion which forced them to retreat to Loch Modan and seal the passage."},{n(-4,{ach(774,{OnClick=_.CommonAchievementHandlers.EXPLORATION_OnClick,OnUpdate=_.CommonAchievementHandlers.EXPLORATION_OnUpdate}),ach(4910,{crit(1,{sourceQuests={27964}}),crit(2,{sourceQuests={27979,28099}}),crit(3,{sourceQuests={28035}}),crit(4,{sourceQuests={28064}})})}),n(-15,{exp(1957,{maphash="275:235:77:366"}),exp(1959,{maphash="460:365:422:8"}),exp(1958,{maphash="305:230:545:407"}),exp(1442,{maphash="405:430:85:30"}),exp(246,{maphash="425:325:250:170"}),exp(247,{maphash="305:220:494:300"}),exp(1444,{maphash="360:280:247:388"})}),n(-6,{fp(673,{coords={{41,68.6,1427}},crs={47927}}),fp(74,{coords={{